import React from 'react'
import {
  Link,
} from 'react-router-dom'
import logo from '../../logo.svg'
import styles from './Header.module.css'

const Header = () => {
  const listMenu = [
    {
      id: 1,
      title: 'Home',
      link: '/',
    },
    {
      id: 2,
      title: 'Courses',
      link: '/courses',
    },
    {
      id: 3,
      title: 'Become a teacher',
      link: '/becomeateacher',

    },
    {
      id: 4,
      title: 'Account',
      link: '/account',
    },
  ]
  return (
    <div className={styles.AppHeader}>
      <img src={logo} className="AppLogo" alt="logo" />
      <div className="AppHeaderMenu">
        <div>
          <nav>
            <ul className="AppHeaderMenuItem">
              {listMenu.map((item) => <li key={item.id}>
                <Link
                  onClick={() => {

                  }}
                  to={item.link}
                >
                  {item.title}
                </Link>
              </li>)}
            </ul>
          </nav>
        </div>
      </div>
    </div>
  )
}
export default Header
